import React from 'react';
import Toolbar from './Toolbar'
import Log from './Log'
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Toolbar/>
        <div>
          <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
          <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
          <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
          <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
          <Log timeStamp="now" categories={["log", "system"]} log="hello world" trace="stack" info="info" />
        </div>
      </div>
    );
  }
}

export default App;
